function dsOutRace_OnRowPosChanged(obj,nOldRow,nRow)
{
		stRaceNo.Text = "( " + dsOutRace.GetColumn(dsOutRace.row, "RACE_NO") + " 경주 )";
		//nSumIndex = dsOutRace.GetColumn(dsOutRace.row, "SUM_INDEX");

		var regNoCnt = dsOutRace.GetColumn(dsOutRace.row, "RACE_REG_NO_CNT");

		fcSearchRaceRefe();
		fcSearchOrgan();
		fcSearchVoilAct();
		fcSearchRank();
		fcSearchDecision();
		fcSearchMeasure();
		fcSearchRaceAnal();
		fcSearchDivRate();
		fcSearchRaceMoney();
		fcSearchRiskIndex();

		//alert("dsOutRace row : " + dsOutRace.row + " regNoCnt : " + regNoCnt); 

		setGrdRaceSize(regNoCnt);
		setGrdOrganSize(regNoCnt);
		setGrdMeasureSize(regNoCnt);
		setGridSize(regNoCnt);
		setGrdPageList45Size(regNoCnt);
}

//DataSet 정상  로드시
function dsOutDivRate_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{

	setDsOutDivMap();

	//각 승식별 Data 분배
	var nRowCount = dsOutDivRate.GetRowCount();

	//승식
	var sPoolCd;
	//컬럼명
	var sColId;
	//조건식에 맞는 Record Index
	var nSearchRow, iRow;
	var nSearchRowMap;
	var oDataSet;
	var sRUNNER_1ST;
	var sRUNNER_2ND;
	var sRUNNER_3RD;
	//배당률
	var sODDS;
	//조건식
	var sSearch;

	dsOutDivRate_001.FireEvent = false;
	dsOutDivRate_002.FireEvent = false;
	dsOutDivRate_004.FireEvent = false;
	dsOutDivRate_005.FireEvent = false;
	dsOutDivRate_006.FireEvent = false;

	for (var i = 0; i < nRowCount; i++)
	{
		sPoolCd		= dsOutDivRate.GetColumn(i, "POOL_CD");
		sRUNNER_1ST = dsOutDivRate.GetColumn(i, "RUNNER_1ST");
		sRUNNER_2ND = dsOutDivRate.GetColumn(i, "RUNNER_2ND");
		sRUNNER_3RD = dsOutDivRate.GetColumn(i, "RUNNER_3RD");
		sODDS		= dsOutDivRate.GetColumn(i, "ODDS");

		sSearch		= "POOL_CD = '" + sPoolCd;
		sSearch    += "' && RUNNER_1ST = '" + sRUNNER_1ST + "' && RUNNER_2ND = '" + sRUNNER_2ND;
		sSearch    += "' && RUNNER_3RD = '" + sRUNNER_3RD + "'";

		nSearchRowMap	= dsOutDivMap.SearchRow(sSearch);

		if (nSearchRowMap > -1)
		{
			oDataSet		= object(dsOutDivMap.GetColumn(nSearchRowMap, "DATASET_ID"));
			nSearchRow		= dsOutDivMap.GetColumn(nSearchRowMap, "GRID_ROW");
			sColId			= dsOutDivMap.GetColumn(nSearchRowMap, "COL_VALUE");

			//iRow = oDataSet.AddRow();
			oDataSet.SetColumn(nSearchRow, sColId, dsOutDivRate.GetColumn(i, "ODDS"));
		}
	}

	// 승식별 최소배당률 구하기(데이타셋의 정렬이 승식별 배당률 순으로 되어 있으므로 승식별 시작점 데이타 찾기
    if(dsOutDivRate.GetRowCount() > 0){
		iMinRate001 = dsOutDivRate.GetColumn(dsOutDivRate.FindRow("POOL_CD", "001"), "ODDS");
		iMinRate002 = dsOutDivRate.GetColumn(dsOutDivRate.FindRow("POOL_CD", "002"), "ODDS");
		iMinRate004 = dsOutDivRate.GetColumn(dsOutDivRate.FindRow("POOL_CD", "004"), "ODDS");
		iMinRate005 = dsOutDivRate.GetColumn(dsOutDivRate.FindRow("POOL_CD", "005"), "ODDS");
		iMinRate006 = dsOutDivRate.GetColumn(dsOutDivRate.FindRow("POOL_CD", "006"), "ODDS");
    }

	dsOutDivRate_001.FireEvent = true;
	dsOutDivRate_002.FireEvent = true;
	dsOutDivRate_004.FireEvent = true;
	dsOutDivRate_005.FireEvent = true;
	dsOutDivRate_006.FireEvent = true;
}

// 순위별 나열
function fcRankSort(sCol) {
    var sRtn;

    if(dsOutRaceResult.GetRowCount() > 0){
		var nCnt = dsOutRaceResult.rowcount;

		// 정렬 - 주어진 컬럼 순으로.
		dsOutRaceResult.Sort(sCol, true);
		// 순위셋팅
		for (var i = 0; i < nCnt; i++)
		{
			if (dsOutRaceResult.GetColumn(i, sCol) != "0") {
				sRtn = sRtn + " " + dsOutRaceResult.GetColumn(i, "RACE_REG_NO");
			}
		}
    }
    return sRtn;
}

