/*-------------------------------------------------------------------------------------------------+
>>  최고정번수에 따른 DsOutDivMap(매핑 데이터셋 변경).
+-------------------------------------------------------------------------------------------------*/
function setDsOutDivMap(){
	var maxRegNoCnt = dsOutRace.GetColumn(dsOutRace.row, "RACE_REG_NO_CNT");

	if(maxRegNoCnt == 7){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_7");
	}else if(maxRegNoCnt == 8){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_8");
	}else{
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_6"); // default..
	}
}


//경주선택 그리드 높이 조절.
function setGrdRaceSize(regNoCnt){

	var rowCnt = dsOutRace.GetRowCount();
	var rowHeight = grdRace.RowHeight;
	var gridHeight = ( rowCnt + 1) * rowHeight;
	var gap = 20;

	grdRace.Height = gridHeight;
	Grid1.Top = grdRace.Bottom + gap;
}

