//최종 배당률 그리드 사이즈 조절.
function setGridSize(regNoCnt){
	var maxRegNoCnt = regNoCnt;

	btnRiskIndex.Enable = false;

	var rowHeight = grdPageList_001.RowHeight;
	var gridHeight = (maxRegNoCnt + 2) * rowHeight + 5;
	var gap = 3;

	grdPageList_001.Height = gridHeight;
	grdPageList_002.Height = gridHeight;

	grdPageList_004.Height = gridHeight;
	grdPageList_004.Top = grdPageList_001.Bottom + gap;

	grdPageList_005.Height = gridHeight;
	grdPageList_005.Top = grdPageList_004.Bottom + gap;

	grdPageList_006.Top = grdPageList_005.Bottom + gap;
	grdRaceMoney.Top = grdPageList_006.Bottom + gap;

	grdRiskIndex.Height = gridHeight;
	grdRiskIndex.Top = grdRaceMoney.Bottom + gap;

	btnRiskIndex.Top = grdRiskIndex.Top - btnRiskIndex.Height - gap;


	btnRiskIndex.Enable = true;
}

/*-------------------------------------------------------------------------------------------------+
>>  경주별 최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setGrdPageList45Size(regNoCnt){
	/*
		IWORK_SFR-008 경정 선수편성 메뉴 개선  정번8 까지 추가 수정.
		회차에 따른 최고(8까지)정번수 별로 1 ~ 정번수 까지 화면에 표시.
	*/
	var nMaxTmsRunCnt = 8;
	var nMaxRaceRegNoCnt = -1;

	nMaxRaceRegNoCnt = regNoCnt;

	if(nMaxRaceRegNoCnt == -1 || fnc_IsNull(nMaxRaceRegNoCnt)) nMaxRaceRegNoCnt = 6;

	//Alert("nMaxRaceRegNoCnt : " + nMaxRaceRegNoCnt);

	grdPageList_004.Redraw = false;
	grdPageList_005.Redraw = false;

	//전체적으로 사이즈를 넓힘.
	for ( var i = 0; i < nMaxTmsRunCnt; i++ ) {
        grdPageList_004.SetColProp(i+1, "Width", 40);
        grdPageList_005.SetColProp(i+1, "Width", 40);
    }

    //nMaxTmsRunCnt 부터 nMaxRaceRegNoCnt까지 사이즈를 줄임.
    for ( var i = nMaxTmsRunCnt; i > nMaxRaceRegNoCnt; i-- ) {
        grdPageList_004.SetColProp(i, "Width", 0);
        grdPageList_005.SetColProp(i, "Width", 0);
    }

    grdPageList_004.SetColProp(0, "Width", 20);
    grdPageList_005.SetColProp(0, "Width", 20);

    grdPageList_004.Redraw = true;
    grdPageList_005.Redraw = true;
}
